import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import FavoriteIcon from '@mui/icons-material/Favorite';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';

function Homepage() {
    const songs = [
        {
            songName: 'Huso',
            artistName: 'Mujo',
            url: 'www.facebook.com',
            rating: 2,
            favourite: true,
            dateEntered: '24 july',
            dateLastEdited: '24 july'
        },
        {
            songName: 'Haso',
            artistName: 'Meho',
            url: 'www.facebook.com',
            rating: 3,
            favourite: false,
            dateEntered: '24 july',
            dateLastEdited: '24 july'
        },
        {
            songName: 'Rasim',
            artistName: 'Zilha',
            url: 'www.facebook.com',
            rating: 2,
            favourite: true,
            dateEntered: '24 july',
            dateLastEdited: '24 july'
        },
        {
            songName: 'Bego',
            artistName: 'Nusret',
            url: 'www.facebook.com',
            rating: 1,
            favourite: false,
            dateEntered: '24 july',
            dateLastEdited: '24 july'
        }
    ]
